#表结构
#java基本数据类型：
varchar, char, long, int, double, float, timestamp, datetime
CREATE TABLE IF NOT EXISTS testtsdb (
		order_id char COMMENT 'field_订单id',
		user_name VARCHAR COMMENT 'tag_姓名',	
		identity_card VARCHAR COMMENT 'tag_身份证',
		sex VARCHAR COMMENT 'tag_性别',
		height double COMMENT 'field_身高(cm)',
		weight float COMMENT 'field_体重(kg)',
		age int COMMENT 'field_年龄',
		education VARCHAR COMMENT 'tag_学历',
		phone long  COMMENT 'tag_电话',
		qq long COMMENT 'field_qq账号',
		school_tag  VARCHAR COMMENT 'tag_毕业学校',
		reg_time char COMMENT 'field_注册时间',
		user_money double COMMENT 'field_资金',
		live_addr VARCHAR COMMENT 'tag_地址',
		post_state varchar COMMENT 'tag_省province',
		post_city char COMMENT 'tag_城市post_city',
		post_area VARCHAR COMMENT 'tag_县区,post_area',
		createtime char COMMENT 'field_下单时间',
		pay_time char COMMENT 'field_支付时间',
		money_paid  float COMMENT 'field_已付金额',		
		centdate int COMMENT 'field_今日时间',
		order_uptime char COMMENT 'field_更新时间',
		timestamp datetime )

-- ----------------------------
-- Records of testtsdb
-- ----------------------------
